import 'braft-editor/dist/index.css'
import 'braft-extensions/dist/code-highlighter.css'

import React from 'react'
import BraftEditor from 'braft-editor'
import { Base64 } from 'js-base64'
import CodeHighlighter from 'braft-extensions/dist/code-highlighter'
import { Col, Row } from 'antd'

// 代码高亮插件
BraftEditor.use(CodeHighlighter())

const title = `
<h1 style="text-align:center;"><span style="font-size:40px">文章标题</span></h1>`

const text = `
`

const decode = decodeURIComponent(Base64.decode(text))

class ViewBlog extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      editorState: BraftEditor.createEditorState(title + decode),
    }
  }

  componentDidMount() {
    // 清除高度, 默认是500px
    if (document.querySelector('.bf-content')) {
      document.querySelector('.bf-content').classList = ''
    }
  }

  handleEditorChange = (editorState) => {
    this.setState({ editorState })
  }

  render() {
    const { editorState } = this.state
    return (
      <Row justify="space-around" type="flex">
        <Col lg={ 18 } span={ 24 }>
          <div style={ {
            backgroundColor: 'white',
            padding: '8px',
          } }>
            <BraftEditor
              value={ editorState }
              controls={ [] }
              readOnly="true"
            />
          </div>
        </Col>
      </Row>
    )
  }
}

export default ViewBlog
